// import express from 'express'
// const nodeExternals = require("webpack-node-externals");
const express = require('express')

const app = express()
const port = 3000

app.get('/', function (req, res) {
    res.send('Hello World')
})

app.listen(port, () => {
    console.log(`Example app listening on port ${port}`)
})
